import React, { useEffect, useState } from 'react';
import AWS from '../aws-config';
import { Link } from 'react-router-dom';

const Internship2022 = ({ section }) => {
  const [internship, setInternship] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const dynamoDb = new AWS.DynamoDB.DocumentClient();

      const params = {
        TableName: 'Internships',
        Key: {
          InternshipCompany: 'Amazon Web Services, Inc.',
          InternshipName: 'AWS Summer 2022 Internship',
        },
      };

      try {
        const data = await dynamoDb.get(params).promise();
        console.log('Fetched internship data:', data.Item); // Debugging
        if (data.Item) {
          setInternship(data.Item);
        } else {
          console.error('No internship data found.');
        }
      } catch (error) {
        console.error('Error fetching internship:', error);
      }
    };

    fetchData();
  }, [section]);

  return (
    <div className="internship-container">
      <h1>Amazon Summer 2022 Internship</h1>
      {internship && internship.Subheading && internship.Subheading.M ? (
        <div className="subheading">
          <p>
            <strong>{internship.Subheading.M.Title?.S}</strong> â€” {internship.Subheading.M.Dates?.S} in {internship.Subheading.M.Location?.S}
          </p>
        </div>
      ) : (
        <div className="subheading">
          <p>No subheading data available.</p>
        </div>
      )}
      {internship ? (
        <div>
          {section === 'role' && (
            <div className="role-overview">
              <h2>Role Overview</h2>
              {internship.RoleAndResponsibilities?.M?.RoleOverview?.S ? (
                <p>{internship.RoleAndResponsibilities.M.RoleOverview.S}</p>
              ) : (
                <p>No role overview data found.</p>
              )}

              <h2>Responsibilities</h2>
              {internship.RoleAndResponsibilities?.M?.Responsibilities?.S ? (
                <p dangerouslySetInnerHTML={{ __html: internship.RoleAndResponsibilities.M.Responsibilities.S }} />
              ) : (
                <p>No responsibilities data found.</p>
              )}
            </div>
          )}
          {section === 'accomplishments' && (
            <div className="accomplishments">
              <h2>Accomplishments</h2>
              {internship.Accomplishments?.S ? (
                <p dangerouslySetInnerHTML={{ __html: internship.Accomplishments.S }} />
              ) : (
                <p>No accomplishments data found.</p>
              )}
            </div>
          )}
          {section === 'project' && (
            <div className="project">
              <h2>Project</h2>
              {internship.Project?.S ? (
                <p>{internship.Project.S}</p>
              ) : (
                <p>No project data found.</p>
              )}
              <a href="/projects/sa-hiring" className="oval-button">Solutions Architect Hiring Factory Automation Project</a>
            </div>
          )}
        </div>
      ) : (
        <p>No internship data found.</p>
      )}
    </div>
  );
};

export default Internship2022;
